import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

function ULPlot({ data }) {
  return (
    <LineChart width={600} height={300} data={data}>
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="timestamp" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Line type="monotone" dataKey="0" stroke="yellow" />
      <Line type="monotone" dataKey="1" stroke="green" />
      <Line type="monotone" dataKey="missing" stroke="red" />
    </LineChart>
  );
}

export default ULPlot;
